    internal class IndexInfo
    {
        public string Name { get; set; }
        public string TableName { get; set; }
        public string Type { get; set; }
        public bool? IsUnique { get; set; }
        public bool? IsPrimaryKey { get; set; }
        public bool? IgnoreDuplicateKey { get; set; }
        public List<string> Columns { get; set; }
        public List<string> ReorderedColumns { get; set; }
        public List<string> IncludedColumns { get; set; }
        public List<string> ReorderedIncludedColumns { get; set; }
        public bool NewIndex { get; set; }
        public IndexInfo Replaces { get; set; }
        public IndexInfo ReplacedBy { get; set; }

        public Dictionary<string, int> GetColumns()
        {
            return (ReorderedColumns ?? Columns)?.Select((c, i) => (c, i)).ToDictionary(t => t.c, t => t.i + 1) ?? new Dictionary<string, int>();
        }

        public Dictionary<string, int> GetIncludedColumns()
        {
            return (ReorderedIncludedColumns ?? IncludedColumns)?.Select((c, i) => (c, i)).ToDictionary(t => t.c, t => t.i + 1) ?? new Dictionary<string, int>();
        }
    }

