                if (replaces == null)
                {
                    continue;
                }

                var columnsToAddToColumns = replaces.Columns.Where(c => !columns.ContainsKey(c)).ToList();

                if (columnsToAddToColumns.Count > 0)
                {
                    index.ReorderedIncludedColumns = new List<string>(index.IncludedColumns);
                    index.ReorderedColumns = new List<string>(index.Columns);
                    replaces.ReorderedColumns = new List<string>(replaces.Columns);

                    foreach (var c in columnsToAddToColumns)
                    {
                        index.ReorderedIncludedColumns?.Remove(c);
                        index.ReorderedColumns.Add(c);
                        replaces.ReorderedColumns.Remove(c);
                        replaces.ReorderedColumns.Add(c);
                    }
                }

                index.Replaces = replaces;
                replaces.ReplacedBy = index;
            }

            foreach (var index in indexes.Where(i => i.ReplacedBy != null)
                                         .OrderBy(i => i.Columns.Count)
                                         .ThenBy(i => i.IncludedColumns?.Count))
            {
                var columns = index.GetColumns();
                var includedColumns = index.GetIncludedColumns();

                index.ReplacedBy.ReorderedColumns = (index.ReplacedBy.ReorderedColumns ?? index.ReplacedBy.Columns)?
                                                         .OrderByDescending(c => columns.ContainsKey(c))
                                                         .ThenBy(c =>
                                                                     {
                                                                         columns.TryGetValue(c, out var value);
                                                                         return value;
                                                                     })
                                                         .ToList();

                if (index.ReplacedBy.ReorderedColumns != null &&
                    index.ReplacedBy.ReorderedColumns.Aggregate(string.Empty, (a, c) => $"{a}{c}, ",a => a.TrimEnd(new char[] {' ', ','})) ==
                    index.ReplacedBy.Columns.Aggregate(string.Empty, (a, c) => $"{a}{c}, ", a => a.TrimEnd(new char[] {' ', ','})))
                {
                    index.ReplacedBy.ReorderedColumns = null;
                }

                index.ReplacedBy.ReorderedIncludedColumns = (index.ReplacedBy.ReorderedIncludedColumns ?? index.ReplacedBy.IncludedColumns)?
                                                                .OrderByDescending(c => includedColumns.ContainsKey(c))
                                                                .ThenBy(c =>
                                                                            {
                                                                                includedColumns.TryGetValue(c, out var value);
                                                                                return value;
                                                                            })
                                                                .ToList();

                if (index.ReplacedBy.ReorderedIncludedColumns != null &&
                    index.ReplacedBy.ReorderedIncludedColumns.Aggregate(string.Empty, (a, c) => $"{a}{c}, ", a => a.TrimEnd(new char[] { ' ', ',' })) ==
                    index.ReplacedBy.IncludedColumns.Aggregate(string.Empty, (a, c) => $"{a}{c}, ", a => a.TrimEnd(new char[] { ' ', ',' })))
                {
                    index.ReplacedBy.ReorderedIncludedColumns = null;
                }
            }

            const string fileName = @"C:\tmp\indexes.tsv";

            var header = string.Format("{0}\t{1}\t{2}\t{3}\t{4}\t{5}\t{6}\t{7}\t{8}\t{9}\t{10}\t{11}\t{12}\t{13}\t{14}\t{15}\t{16}\t{17}\t{18}\t{19}\t{20}\t{21}\t{22}\t{23}\t{24}\t{25}\t{26}\t{27}\t{28}\n",
                                       "Name",
                                       "New?",
                                       "TableName",
                                       "Type",
                                       "Is unique?",
                                       "Is primary key?",
                                       "Ignore duplicate key?",
                                       "Columns",
                                       "Columns count",
                                       "Reordered columns",
                                       "Reordered columns count",
                                       "Included columns",
                                       "Included columns count",
                                       "Reordered included columns",
                                       "Reordered included columns count",
                                       "Replaces",
                                       "Replaces New?",
                                       "Replaces type",
                                       "Replaces columns",
                                       "Replaces columns count",
                                       "Replaces Included columns",
                                       "Replaces Included columns count",
                                       "Replaced By",
                                       "Replaced By New?",
                                       "Replaced By type",
                                       "Replaced By columns",
                                       "Replaced By columns count",
                                       "Replaced By Included columns",
                                       "Replaced By Included columns count");

            File.WriteAllText(fileName, header);
            Console.Write(header);

            foreach (var index in indexes.OrderByDescending(i => i.Columns.Count).ThenByDescending(i => i.IncludedColumns?.Count))
            {
                var detail = string.Format("{0}\t{1}\t{2}\t{3}\t{4}\t{5}\t{6}\t{7}\t{8}\t{9}\t{10}\t{11}\t{12}\t{13}\t{14}\t{15}\t{16}\t{17}\t{18}\t{19}\t{20}\t{21}\t{22}\t{23}\t{24}\t{25}\t{26}\t{27}\t{28}\n",
                                           index.Name,
                                           index.NewIndex,
                                           index.TableName,
                                           index.Type,
                                           index.IsUnique,
                                           index.IsPrimaryKey,
                                           index.IgnoreDuplicateKey,
                                           index.Columns.Aggregate(string.Empty, (a,c) => $"{a}{c}, ", a => a.TrimEnd(new char[] {' ', ','})),
                                           index.Columns.Count,
                                           index.ReorderedColumns?.Aggregate(string.Empty, (a, c) => $"{a}{c}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.ReorderedColumns?.Count,
                                           index.IncludedColumns?.Aggregate(string.Empty, (a, c) => $"{a}{c}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.IncludedColumns?.Count,
                                           index.ReorderedIncludedColumns?.Aggregate(string.Empty, (a, c) => $"{a}{c}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.ReorderedIncludedColumns?.Count,
                                           index.Replaces?.Name,
                                           index.Replaces?.NewIndex,
                                           index.Replaces?.Type,
                                           index.Replaces?.GetColumns().Aggregate(string.Empty, (a, c) => $"{a}{c.Key}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.Replaces?.GetColumns().Count,
                                           index.Replaces?.GetIncludedColumns().Aggregate(string.Empty, (a, c) => $"{a}{c.Key}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.Replaces?.GetIncludedColumns().Count,
                                           index.ReplacedBy?.Name,
                                           index.ReplacedBy?.NewIndex,
                                           index.ReplacedBy?.Type,
                                           index.ReplacedBy?.GetColumns().Aggregate(string.Empty, (a, c) => $"{a}{c.Key}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.ReplacedBy?.GetColumns().Count,
                                           index.ReplacedBy?.GetIncludedColumns().Aggregate(string.Empty, (a, c) => $"{a}{c.Key}, ", a => a.TrimEnd(new char[] { ' ', ',' })),
                                           index.ReplacedBy?.GetIncludedColumns().Count);

                File.AppendAllText(fileName, detail);
                Console.Write(detail);
            }

            Console.WriteLine("Press any key to finish.");
            Console.ReadKey(false);
        }
    }
}
